import './PromiseHero.css'

const PromiseHero = () => {
  return (
    <div className='promise-hero'>
      <h2 className="h2-extra-bold">Promise Path</h2>
      <h3 className="h3-bold">Find the Perfect Program</h3>
    </div>
  )
}

export default PromiseHero
